const Tasks = ({ tasks, onDelete, onToggle }) => {
  return (
    <>
      {tasks.map((task) => (<Task key={task.id} task={task} onDelete={onDelete} onToggle={toggleReminder} />))}
    </>
  )
}

export default Tasks
